import React, {Component} from 'react';
import './App.css';
import Navbar from "./components/Navbar/Navbar";
import Menu from "./components/Menu/Menu";
import {Route, BrowserRouter as Router, Switch} from "react-router-dom";
import routes from "./routes";

class App extends Component {
    render() {
        return (
            <Router>
                <div className="test">
                    <Navbar/>
                    <Menu/>
                    {/*<div className="col-md-10 float-right">*/}
                        {/*{this.showContentMenus(routes)}*/}
                    {/*</div>*/}
                    <h2>
                        Tiếp đó, có ai ngờ đang lướt qua những tầng mây thì phi công đột ngột thông báo: "Chúng ta sẽ quay đầu và trở về sân bay O'Hare. Loại máy bay E-175 với 76 chỗ này quá lớn để đáp xuống sân bay Chattanooga".

                        Vị hành khách Vince Fallon nói với tờ USA Today rằng lúc đó máy bay đã đi được nửa đường, có lẽ đến không phận bang Kentucky (xác định dựa trên bản đồ bay mà cô Vince có được) thì nghe được "thông báo kém vui" của phi công.

                        Nữ hành khách Jill Lohsen cũng thấy rất khó hiểu. "Bình thường tôi bay với hãng Delta cũng dùng loại 76 chỗ mà có bị gì đâu", cô Jill cho biết.

                        50 hành khách đã buộc phải quay lại sân bay O'Hare vào lúc 4 giờ rưỡi chiều. Mỗi người nhận 1 phần ăn nhỏ và được sắp xếp lên chuyến bay tiếp theo vào 1 giờ sau.

                        Tiếp đó, có ai ngờ đang lướt qua những tầng mây thì phi công đột ngột thông báo: "Chúng ta sẽ quay đầu và trở về sân bay O'Hare. Loại máy bay E-175 với 76 chỗ này quá lớn để đáp xuống sân bay Chattanooga".

                        Vị hành khách Vince Fallon nói với tờ USA Today rằng lúc đó máy bay đã đi được nửa đường, có lẽ đến không phận bang Kentucky (xác định dựa trên bản đồ bay mà cô Vince có được) thì nghe được "thông báo kém vui" của phi công.

                        Nữ hành khách Jill Lohsen cũng thấy rất khó hiểu. "Bình thường tôi bay với hãng Delta cũng dùng loại 76 chỗ mà có bị gì đâu", cô Jill cho biết.

                        50 hành khách đã buộc phải quay lại sân bay O'Hare vào lúc 4 giờ rưỡi chiều. Mỗi người nhận 1 phần ăn nhỏ và được sắp xếp lên chuyến bay tiếp theo vào 1 giờ sau.
                    </h2>
                </div>
            </Router>
        );
    }

    showContentMenus = (routes) => {
        let result = null;
        if(routes.length > 0) {
            result = routes.map((route, index) => {
                return (
                    <Route
                        key={index}
                        path={route.path}
                        exact={route.exact}
                        component={route.main}
                    />
                )
            });
        }
        return <Switch>{result}</Switch>
    }
}

export default App;
